import React from "react";
import Footer from "../components/footer/Footer";

function Registo() {
  return(

    <div>
       <main>
         <a href="homePage.html">
            <img class="lettering" src="img/lettering.png" alt="lettering" height="180"/>
        </a>
       </main>

      <Footer/>
    </div>
  )
}

export default Registo;
